INSERT INTO job VALUES (1,3,'THEOPHYLLINE POPULATION DATA 1',1,'1',1,'1','<?xml version=\"1.0\"?>\n<spksource>\n   <nonmem version=\"0.1\">\n      <constraint>\n         <pop_analysis approximation=\"fo\" is_estimation=\"yes\" is_eta_out=\"no\" is_restart=\"no\" pop_size=\"12\">\n            <description>THEOPHYLLINE POPULATION DATA</description>\n            <data_labels>\n               <label name=\"ID\"/>\n               <label name=\"AMT\" synonym=\"DOSE\"/>\n               <label name=\"TIME\"/>\n               <label name=\"DV\" synonym=\"CP\"/>\n               <label name=\"WT\"/>\n            </data_labels>\n            <theta length=\"3\">\n               <low>\n                  <value fixed=\"no\">.1</value>\n                  <value fixed=\"no\">.008</value>\n                  <value fixed=\"no\">.004</value>\n               </low>\n               <in>\n                  <value fixed=\"no\">3</value>\n                  <value fixed=\"no\">.08</value>\n                  <value fixed=\"no\">.04</value>\n               </in>\n               <up>\n                  <value fixed=\"no\">5</value>\n                  <value fixed=\"no\">.5</value>\n                  <value fixed=\"no\">.9</value>\n               </up>\n            </theta>\n            <omega dimension=\"3\" same_as_previous=\"no\" struct=\"block\">\n               <in>\n                  <value fixed=\"no\">6</value>\n                  <value fixed=\"no\">.005</value>\n                  <value fixed=\"no\">.0002</value>\n                  <value fixed=\"no\">.3</value>\n                  <value fixed=\"no\">.006</value>\n                  <value fixed=\"no\">.4</value>\n               </in>\n            </omega>\n            <sigma dimension=\"1\" same_as_previous=\"no\" struct=\"diagonal\">\n               <in>\n                  <value fixed=\"no\">.4</value>\n               </in>\n            </sigma>\n            <pop_stat covariance_form=\"rsr\"/>\n         </pop_analysis>\n      </constraint>\n      <model>\n         <pred>\n;THETA(1)=MEAN ABSORPTION RATE CONSTANT (1/HR)\n;THETA(2)=MEAN ELIMINATION RATE CONSTANT (1/HR)\n;THETA(3)=SLOPE OF CLEARANCE VS WEIGHT RELATIONSHIP (LITERS/HR/KG)\n;DOSE=WT-ADJUSTED DOSE (MG/KG)\n;DS=NON-WT-ADJUSTED DOSE (MG)\n   IF (DOSE.NE.0) THEN\n      DS=DOSE*WT\n      W=WT\n   ENDIF\n   KA=THETA(1)+ETA(1)\n   KE=THETA(2)+ETA(2)\n   CL=THETA(3)*W+ETA(3)\n   D=EXP(-KE*TIME)-EXP(-KA*TIME)\n   E=CL*(KA-KE)\n   F=DS*KE*KA/E*D\n   Y=F+EPS(1)\n         </pred>\n      </model>\n      <presentation>\n         <table header=\"every\" process=\"estimation\">\n            <column appearance_order=\"1\" label=\"ID\" sort_order=\"0\"/>\n            <column appearance_order=\"2\" label=\"DOSE\" sort_order=\"0\"/>\n            <column appearance_order=\"3\" label=\"WT\" sort_order=\"0\"/>\n            <column appearance_order=\"4\" label=\"TIME\" sort_order=\"0\"/>\n            <column appearance_order=\"5\" label=\"DV\" sort_order=\"0\"/>\n            <column appearance_order=\"6\" label=\"PRED\" sort_order=\"0\"/>\n            <column appearance_order=\"7\" label=\"RES\" sort_order=\"0\"/>\n            <column appearance_order=\"8\" label=\"WRES\" sort_order=\"0\"/>\n         </table>\n         <scatterplot begin=\"1\" end=\"900\" process=\"estimation\" unit_slope=\"hide\" x0_line=\"hide\" y0_line=\"hide\">\n            <x label=\"RES\"/>\n            <x label=\"WRES\"/>\n            <y label=\"TIME\"/>\n            <split label=\"ID\"/>\n         </scatterplot>\n      </presentation>\n   </nonmem>\n</spksource>\n','q2c',NULL,1081196561,1081196561,NULL,NULL);
